import React, { useState } from "react";
import { FaCar, FaTools, FaMicrochip } from "react-icons/fa";
import { Card, CardContent } from "./components/Card";
import { Button } from "./components/Button";

const App = [
  { id: "automotive", name: "Automotive", icon: <FaCar />, color: "bg-gray-100" },
  { id: "construction", name: "Construction and Engineering", icon: <FaTools />, color: "bg-blue-200" },
  { id: "electronics", name: "Electronics & High Tech", icon: <FaMicrochip />, color: "bg-gray-100" },
];

export default function Industries() {
  const [selectedIndustry, setSelectedIndustry] = useState("automotive");

  return (
    <div className="p-4">
      <nav className="flex space-x-4 border-b pb-2">
        {["Overview", "Industries", "Manufacturing Modes", "Benefits", "Featured Products", "Resources"].map((tab, index) => (
          <Button
            key={index}
            variant={tab === "Industries" ? "secondary" : "ghost"}
            className={tab === "Industries" ? "bg-blue-200 text-blue-700" : ""}
          >
            {tab}
          </Button>
        ))}
      </nav>

      <div className="mt-4 space-y-4">
        {industries.map(({ id, name, icon, color }) => (
          <Card
            key={id}
            className={`flex items-center p-4 rounded-lg cursor-pointer ${color} ${
              selectedIndustry === id ? "border-2 border-blue-500" : ""
            }`}
            onClick={() => setSelectedIndustry(id)}
          >
            <div className="text-2xl mr-4">{icon}</div>
            <CardContent className="text-lg font-medium">{name}</CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
}
